import React from "react";
import { Table } from "reactstrap";
const TableContainer = () => {
  return (
    <div>
      <Table hover>
        <thead>
          <tr>
            <th>id</th>
            <th>email</th>
            <th>UserName</th>
            <th>FullName</th>
            <th>Department</th>
            <th>Position</th>
            <th>Cretate Date</th>
            <th>Edit</th>
            <th>Delete</th>
          </tr>
        </thead>
      </Table>
    </div>
  );
};

export default TableContainer;
